import{_ as e,o as t,c as r,Q as i}from"./chunks/framework.8f76c11e.js";const S=JSON.parse('{"title":"SPACE","titleTemplate":"Service Level Agreement","description":"","frontmatter":{"title":"SPACE","titleTemplate":"Service Level Agreement"},"headers":[],"relativePath":"sla.md","filePath":"sla.md"}'),a={name:"sla.md"},o=i('<h1 id="succeedium-service-level-agreement" tabindex="-1">Succeedium Service Level Agreement <a class="header-anchor" href="#succeedium-service-level-agreement" aria-label="Permalink to &quot;Succeedium Service Level Agreement&quot;">​</a></h1><p>Updated: November 10, 2021</p><h2 id="succeedium-sla" tabindex="-1">Succeedium SLA <a class="header-anchor" href="#succeedium-sla" aria-label="Permalink to &quot;Succeedium SLA&quot;">​</a></h2><p>During the Term of the agreement under which Succeedium has agreed to provide the Covered Services to Customer (as applicable, the &quot;Agreement&quot;), the Covered Services web interface will be operational and available to Customer at least 99% of the time in any calendar month. If Succeedium does not meet the Succeedium SLA, and if Customer meets its obligations under this Succeedium SLA, Customer will be eligible to receive the Service Credits described below. This Succeedium SLA states Customer&#39;s sole and exclusive remedy for any failure by Succeedium to meet the Succeedium SLA.</p><h2 id="status-page" tabindex="-1">Status page <a class="header-anchor" href="#status-page" aria-label="Permalink to &quot;Status page&quot;">​</a></h2><p>All of our services are continuously monitored, and you can view their real-time status on our <a href="https://status.succeedium.com/" target="_blank" rel="noreferrer">status page</a>.</p><h2 id="definitions" tabindex="-1">Definitions <a class="header-anchor" href="#definitions" aria-label="Permalink to &quot;Definitions&quot;">​</a></h2><p>The following definitions shall apply to the Succeedium SLA.</p><p>&quot;Downtime&quot; means, for a domain, if there is more than a five percent user error rate. Downtime is measured based on server side error rate. &quot;Covered Services&quot; means the TeamOne Google Sheets add-on for IBM Planning Analytics and Succeedium Planning Analytics Cloud Extension (SPACE). &quot;Monthly Uptime Percentage&quot; means total number of minutes in a calendar month minus the number of minutes of Downtime suffered in a calendar month, divided by the total number of minutes in a calendar month. &quot;Service&quot; means the Succeedium Services. &quot;Service Credit&quot; means the following:</p><table><thead><tr><th>Monthly Uptime Percentage</th><th>Days of Service added to the end of the Service term at no charge to Customer</th></tr></thead><tbody><tr><td>&lt; 99.9% - &gt;= 99.0%</td><td>3</td></tr><tr><td>&lt; 99.0% - &gt;= 95.0%</td><td>7</td></tr><tr><td>&lt; 95.0%</td><td>15</td></tr></tbody></table><h2 id="service-credit-request" tabindex="-1">Service Credit Request <a class="header-anchor" href="#service-credit-request" aria-label="Permalink to &quot;Service Credit Request&quot;">​</a></h2><p>Customer Must Request Service Credit. In order to receive any of the Service Credits described above, Customer must notify Succeedium (or, for Customers who ordered Services from a Reseller, Customer may notify Reseller and Customer&#39;s Reseller must notify Succeedium) within thirty days from the time Customer becomes eligible to receive a Service Credit. Failure to comply with this requirement will forfeit Customer&#39;s right to receive a Service Credit. For Customers who ordered Services from a Reseller, Customer will receive applicable Service Credit from Reseller on behalf of Succeedium.</p><p>Succeedium contact email: <a href="mailto:info@succeedium.com" target="_blank" rel="noreferrer">info@succeedium.com</a></p>',13),s=[o];function c(n,d,u,l,m,h){return t(),r("div",null,s)}const v=e(a,[["render",c]]);export{S as __pageData,v as default};
